import React, { Component } from "react";
import "../App.css";

class Card extends Component {
  state = {
    title: this.props.title,
    message: this.props.message,
    body: this.props.body,
    height: this.props.height
  };

  render() {
    return (
      <div className="card" style={{height: props.height, borderRadius: "5px"}}>
        <div className="card-body" style={{paddingTop: "3rem"}}>
          <h5 className="card-title" style={{fontSize: "2rem"}}>{this.props.title}</h5>
          <p className="card-text" style={{paddingTop: "1rem"}}>{this.props.message}</p>
          <div className="container" style={{height: "38rem"}}>{this.props.body}</div>
        </div>
      </div>
    );
  }
}

export default Card;
